import React from "react";
import "./styles.css";
import strings from "./strings";
import logoImg from "../../Assets/UncutLogo.png";
import facebookLogo from "../../Assets/Facebook.png";
import linkedinLogo from "../../Assets/Linkedin.png";

export default function Footer() {
  const socialArr = [
    { id: "footer-social", src: facebookLogo, alt: strings.facebookAlt },
    { id: "footer-social", src: linkedinLogo, alt: strings.linkedinAlt },
  ];

  return (
    <div id="footer-wrapper">
      <div id="footer-left">
        <div id="footer-social-wrapper">
          {socialArr.map((icon) => {
            return (
              <a href="#">
                <img
                  id="footer-social"
                  src={facebookLogo}
                  alt={strings.facebookAlt}
                />
              </a>
            );
          })}
          {/* <a href="#">
            <img
              id="footer-social"
              src={facebookLogo}
              alt={strings.facebookAlt}
            />
          </a>
          <a href="#">
            <img
              id="footer-social"
              src={linkedinLogo}
              alt={strings.linkedinAlt}
            />
          </a> */}
        </div>
        <div id="footer-details">
          <div id="footer-phone">{strings.phone}</div>
          <div id="footer-copyright">
            Â© {new Date().getFullYear()} {strings.company}
          </div>
        </div>
      </div>
      <div id="footer-plug">
        {strings.websiteBy}
        {"\u2004"}
        <span style={{ fontWeight: "bold" }}>{strings.myName}</span>
      </div>
      <div id="footer-right">
        <img id="footer-logo" src={logoImg} alt={strings.logoAlt} />
      </div>
    </div>
  );
}
